import "./App.css";
import Login from "./pages/Login";
import Register from "./pages/Register";
import Home from "./pages/Home";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { useNavigate, useSelector } from "react-router-dom";
import { useDispatch } from "react-redux";
import { useEffect } from "react";
import Header from "./components/Header";
import { Contact } from "./pages/Contact";
import Footer from "./components/Footer";
import { Product } from "./pages/Product";
import Cart from "./pages/cart";
import CheckOut from "./pages/CheckOut";
import  Payment  from "./pages/Payment";
import OrderReview from "./pages/OrderReview";
import Receipt from "./pages/Receipt";
import OrderHistory from "./pages/OrderHistory";
import Profile from "./pages/Profile";
import AllProducts from "./pages/AllProducts";
import Category from "./pages/category";
import AddProduct from "./pages/AddProduct";

function App() {
  function DynamivRoute() {
    const dispatch = useDispatch();
    const navigate = useNavigate();
    const user = useSelector(state => state.userReducer);

    useEffect(() => {
      // const user = JSON.parse(localStorage.getItem("user"));
      console.log('user',user)
      // if (user.user) {
      //   dispatch({ type: "Login_Success", payload: user });
      //   navigate("/");
      // } else {
      //   localStorage.removeItem("token");
      //   localStorage.removeItem("user");
      //   dispatch({ type: "Login_Failed" });
      //   navigate("/login");
      // }
    }, []);

    return (
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/login" element={<Login />} />
        <Route exact path="/contact" element={<Contact />} />
        <Route exact path="/register" element={<Register />} />
        <Route exact path="/product_details" element={<Product />} />
        <Route exact path="/cart" element={<Cart />} />
        <Route exact path="/checkout" element={<CheckOut />} />
        <Route exact path="/payment" element={<Payment />} />
        <Route exact path="/order_review" element={<OrderReview />} />
        <Route exact path="/receipt" element={<Receipt />} />
        <Route exact path="/order_history" element={<OrderHistory />} />
        <Route exact path="/profile" element={<Profile />} />
        <Route exact path="/allproducts" element={<AllProducts />} />
        <Route exact path="/category" element={<Category />} />
        <Route exact path="/addproduct" element={<AddProduct />} />



      </Routes>
    )
  }

  return (
    <div className="app-bg">
      <Router>
        <Header />
        <DynamivRoute />
        <Footer />
      </Router>
    </div>
  );
}

export default App;
